<script type=""text/javascript"">
    function uploadcsvfile() {
        if ($(""#selUpDoc"").val() == 0) {
            $(""#lblDocTypeError"").show();
            return false;
        }
        var formData = new FormData();
        formData.append('AnchorDocument', $('#myfile')[0].files[0]);
        formData.append('iDocumentTypeID', $(""#selUpDoc"").val());
        $.ajax({
            url: ""/AnchorCompany/UploadFileDatatoServer/"",
            type: ""POST"",
            dataType: ""json"",
            data: formData,
            contentType: false,
            processData: false,
            success: function (data) {
                
               
                if (data.bResult == true) {
                    Common.CustomSuccessNotify(""Anchor document uploaded"");
                    location.reload();
                }
                else {
                    Common.CustomErrorNotify(data.ReturnMessage);
                    location.reload();
                }
            },
    ");
            WriteLiteral("        error: function (data) {\r\n\r\n            }\r\n        })\r\n    }\r\n</script>\r\n");
